define(["jquery","jquery/ui"],function($){"use strict";$.widget('mage.multiShipping',{options:{addNewAddressBtn:'button[data-role="add-new-address"]',addNewAddressFlag:'#add_new_address_flag',canContinueBtn:'button[data-role="can-continue"]',canContinueFlag:'#can_continue_flag'},_create:function(){$(this.options.addNewAddressBtn).on('click',$.proxy(this._addNewAddress,this));$(this.options.canContinueBtn).on('click',$.proxy(this._canContinue,this));},_addNewAddress:function(){$(this.options.addNewAddressFlag).val(1);this.element.submit();},_canContinue:function(event){$(this.options.canContinueFlag).val(parseInt($(event.currentTarget).data('flag'),10));}});return $.mage.multiShipping;});